import React from 'react';
import Post from './Post'
import props from 'prop-types';

const Posts = () => {
    const posts = props.posts; 

    return (
        <div>
            {posts.map((post) => {
                <div>
                    <Post 
                        text = {post.text}
                        likes = {post.likes}
                        creationDateTime = {post.creationDateTime}
                        id = {post.id}
                    />
                </div>
            })};
        </div>
    )
}

export default Posts;
